import React from 'react';
import { ChakraProvider, Button, ButtonGroup } from "@chakra-ui/react";

function Fianchetto() {

  return (
    <ChakraProvider>
      <div className='Fianchetto'>
        <Button colorScheme='teal' variant='ghost'>New Game</Button>
      </div>
    </ChakraProvider>
  );
}

export default Fianchetto;
